When the last seq file is recovered, the endTimeMap is set and serialized. But this is not updated when inserting new data. Cause the file resource be filtered when adding a time filter.

insert into root.turbine1.d1(timestamp,s1) values(1,1);
insert into root.turbine1.d1(timestamp,s1) values(2,1);

restart iotdb

insert into root.turbine1.d1(timestamp,s1) values(12,1);
insert into root.turbine1.d1(timestamp,s1) values(13,1);

select s1 from root where time > 8

If data is inserted using alias, it will be stored by alias path which leads to the empty result in query.

set storage group to root.sg;
create timeseries root.sg.d1.s1(speed)with datatype=FLOAT, encoding=RLE;
insert into root.sg.d1(timestamp,speed) values(1,1);
select s1 from root.sg.d1;
select speed from root.sg.d1;

On rel/0.9, the grafana connector uses the time unit like this:

```
@Autowired
public BasicDaoImpl(JdbcTemplate jdbcTemplate) {
  this.jdbcTemplate = jdbcTemplate;
  Properties properties = new Properties();
  String tsPrecision = properties.getProperty("timestamp_precision", "ms");
  switch (tsPrecision) {
    case "us":
      TIMESTAMP_RADIX = 1000;
      break;
    case "ns":
      TIMESTAMP_RADIX = 1000_000;
      break;
    default:
      TIMESTAMP_RADIX = 1;
  }
  logger.info("Use timestamp precision {}", tsPrecision);
}

```
That is to say, it always is "ms"! No configuration file is read!
